export const Login = () =>{
    return(
        <form>
            <label>User Id</label>
            <input type='email' placeholder="security3096@iith.ac.in" id='email'></input>
            <label>Password</label>
            <input type='password' placeholder="********" id='password'></input>
            <button>Enter</button>
        </form>
    )
}
